(53, 1, '2020-02-19 16:48:23', '2020-02-19 16:48:23', '<!-- wp:group {\"align\":\"wide\"} -->\n<div class=\"wp-block-group alignwide\"><div class=\"wp-block-group__inner-container\"><!-- wp:paragraph -->\n<p>Kubernetes doesn\'t recycle.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kubernetes supports Trump.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kubernetes honks in traffic jams.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kubernetes makes cell phones in E3.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Kubernetes told your parents that you smoke weed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>DOWN WITH KUBERNETES</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"></div></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:image {\"align\":\"full\",\"id\":37,\"sizeSlug\":\"full\"} -->\n<figure class=\"wp-block-image alignfull size-full\"><img src=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-landscape-2.png\" alt=\"\" class=\"wp-image-37\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:group {\"align\":\"wide\"} -->\n<div class=\"wp-block-group alignwide\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"align\":\"center\",\"textColor\":\"accent\"} -->\n<h2 class=\"has-accent-color has-text-color has-text-align-center\">”I witnessed Kubernetes drowning kittens.” - Dave</h2>\n<!-- /wp:heading --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\">On a cold winter day, Dave was on his way back to his London apartment when he noticed some suspicious activity by the Thames. \"There was Kubernetes. I immediately recognized it because of its helm-shaped head\", reported Dave. \"It had half a dozen dismembered kitten all around it, and was putting handfuls of kitten parts under the water while screaming \'TERMINATING POD - TERMINATING POD\'. It was out of its mind.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"customBackgroundColor\":\"#ffffff\",\"align\":\"wide\"} -->\n<div class=\"wp-block-group alignwide has-background\" style=\"background-color:#ffffff\"><div class=\"wp-block-group__inner-container\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"align\":\"center\"} -->\n<h2 class=\"has-text-align-center\">SUPPORT US IN EXTERMINATING KUBERNETES </h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"align\":\"center\"} -->\n<h2 class=\"has-text-align-center\">FOR A SAFER FUTURE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Make a 10000$ donation now :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"align\":\"center\"} -->\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\" href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">DONATE</a></div>\n<!-- /wp:button --></div></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:gallery {\"ids\":[39,38],\"align\":\"wide\"} -->\n<figure class=\"wp-block-gallery alignwide columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-square-2.png\" alt=\"\" data-id=\"39\" data-full-url=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-square-2.png\" data-link=\"assets/images/2020-square-2/\" class=\"wp-image-39\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-square-1.png\" alt=\"\" data-id=\"38\" data-full-url=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-square-1.png\" data-link=\"http://192.168.99.166:5050/wp-content/themes/twentytwenty/assets/images/2020-square-1/\" class=\"wp-image-38\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->', 'KUBERNETES IS EVERYTHING WRONG IN THIS WORLD', '', 'publish', 'closed', 'closed', '', 'the-new-umoma-opens-its-doors-2', '', '', '2020-02-19 17:00:36', '2020-02-19 17:00:36', '', 0, 'http://192.168.99.166:5050/?page_id=53', 0, 'page', '', 0),
